import 'dart:convert';
import 'dart:io';
import 'dart:typed_data';

class Utils{
  Utils._();

  static Uint8List convertBase64Image(String base64String) {
    try {
      if (Platform.isAndroid) {
        return const Base64Decoder().convert(base64String.replaceAll("\n", ""));
      } else {
        return const Base64Decoder().convert(base64String.split(',').last);
      }
    } catch (e) {
      String defaultImage =
          '';
      return convertBase64Image(defaultImage);
    }
  }
}